import "./header.css";

function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <h1 className="headerTitleBlog">WELCOME</h1>
        <p className="toBlog">to Blog</p>
      </div>
      <img
        className="headerImg"
        src="./header_image_blog.png"
        alt=""
      />
    </div>
  );
}

export default Header;
